package original;
import org.junit.Test;
import static org.junit.Assert.*;

public class WordsInSentenceTest {

    @Test
    public void testIsPrime() {
        assertFalse(WordsInSentence.isPrime(0));
        assertFalse(WordsInSentence.isPrime(1));
        assertTrue(WordsInSentence.isPrime(2));
        assertTrue(WordsInSentence.isPrime(3));
        assertFalse(WordsInSentence.isPrime(4));
        assertTrue(WordsInSentence.isPrime(5));
        assertFalse(WordsInSentence.isPrime(6));
        assertTrue(WordsInSentence.isPrime(7));
        assertFalse(WordsInSentence.isPrime(8));
        assertFalse(WordsInSentence.isPrime(9));
        assertFalse(WordsInSentence.isPrime(10));
        assertTrue(WordsInSentence.isPrime(11));
    }
}

